        public static void QuickSort(int[] A, int p, int r)
        {
           
            if (p < r)
            {
                int q = Partition(A, p, r);
                QuickSort(A, p, q - 1);
                QuickSort(A, q + 1, r);
            }


        }

        private static int Partition(int[] A, int p, int r)
        {
            int x = A[r];
            int temp;

            int i = p;
            for (int j = p; j < r; j++)
            {
                if (A[j] <= x)
                {
                    temp = A[j];
                    A[j] = A[i];
                    A[i] = temp;
                    i++;
                }
            }

            A[r] = A[i];
            A[i] = x;
            return i;
        }
        public static void RandomizeQS(int[] A, int p, int r)
        {
            if (p < r)
            {
                int q = RandParti(A, p, r);
                RandomizeQS(A, p, q - 1);
                RandomizeQS(A, q+1, r);
            }

        }

        public static int RandParti(int[] A, int p, int r)
        {
            Random n = new Random();
            int i = n.Next(p,r);
            int aux = A[r];
            A[r] = A[i];
            A[i] = aux;
            return Partition(A, p, r);
        }

        public static void imprimirArreglo(int[] A)
        {
            String mensaje = "";
            for (int i = 0; i < A.Length; i++)
            {
                mensaje += A[i] + " ";
            }
            Console.WriteLine(mensaje);

        }

        public static void timeQuickSort(int[] A)
        {
            String mensaje = "";
            for (int i = 0; i < 1000; i++)
            {
                Stopwatch t = Stopwatch.StartNew();
                QuickSort(A, 0, A.Length - 1);
                mensaje += t.Elapsed.Seconds + " ";
                
            }
            Console.WriteLine(mensaje);

        }
        public static void timeRandomizeQS(int[] A)
        {
            String mensaje = "";
            for (int i = 0; i < 1000; i++)
            {
                Stopwatch t = Stopwatch.StartNew();
                RandomizeQS(A, 0, A.Length - 1);
                mensaje += t.Elapsed.Seconds + " ";

            }
            Console.WriteLine(mensaje);

        }
    }
